/*given y[species]: mass fractions */
/*returns mean molecular weight (gm/mole) */
void CKMMWY(double * restrict y, int * iwrk, double * restrict  rwrk, double * restrict  wtm)
{
    double YOW = 0;
    double tmp[35];

    for (int i = 0; i < 35; i++)
    {
        tmp[i] = y[i]*imw[i];
    }
    for (int i = 0; i < 35; i++)
    {
        YOW += tmp[i];
    }

    *wtm = 1.0 / YOW;
    return;
}


